    data: |
      SELECT DISTINCT - col1 AS col2, col2 + 56 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 BETWEEN col1 + - col1 AND - - ( - CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q12689.out
    data: |
      -51	79
      -67	114
      -77	96
